import React from 'react';
import useProjectStore from '../stores/projectStore';
import useRiskMatrixStore from '../stores/riskMatrixStore';
import RiskMatrixSelector from './RiskMatrixSelector';
import RiskMatrixReference from './RiskMatrixReference';

const RiskAssessment = () => {
  const { currentProject, hazardIdentificationData } = useProjectStore();
  const { matrixType, setMatrixType } = useRiskMatrixStore();

  if (!currentProject || !hazardIdentificationData) {
    return <div>No data available</div>;
  }

  return (
    <div className="p-4">
      <h2 className="text-2xl font-bold mb-4">Risk Assessment</h2>

      {/* Matrix Type Selection */}
      <div className="mb-6">
        <RiskMatrixSelector 
          matrixType={matrixType} 
          setMatrixType={setMatrixType}
        />
      </div>

      {/* Matrix Reference */}
      <div className="mb-6">
        <RiskMatrixReference matrixType={matrixType} />
      </div>

      {/* Risk Assessment Form */}
      <div>
        {hazardIdentificationData.events?.map((event) => (
          <div key={event.uniqueId} className="mb-8">
            <h3 className="text-xl font-semibold mb-4">{event.name}</h3>

            {event.hazards?.map((hazard) => (
              <div key={hazard.uniqueId} className="mb-6 pl-4 border-l-2 border-gray-300">
                <h4 className="text-lg font-medium mb-3">Hazard: {hazard.description}</h4>

                {hazard.consequences?.map((consequence) => (
                  <div key={consequence.uniqueId} className="mb-4 pl-4 border-l-2 border-gray-200">
                    <h5 className="font-medium mb-2">Consequence: {consequence.description}</h5>
                    <div className="bg-gray-50 p-4 rounded">
                      <h6 className="font-medium mb-2">Current Controls:</h6>
                      <p>{consequence.currentControls || 'None specified'}</p>
                    </div>

                    {/* Risk Assessment Fields */}
                    <div className="mt-4 grid grid-cols-2 gap-4">
                      <div>
                        <label className="block text-sm font-medium text-gray-700">Likelihood</label>
                        <select className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500">
                          <option>Select...</option>
                          {matrixType === 'icao' ? (
                            <>
                              <option value="5">5 - Frequent</option>
                              <option value="4">4 - Occasional</option>
                              <option value="3">3 - Remote</option>
                              <option value="2">2 - Improbable</option>
                              <option value="1">1 - Extremely Improbable</option>
                            </>
                          ) : (
                            <>
                              <option value="5">5 - Almost Certain</option>
                              <option value="4">4 - Likely</option>
                              <option value="3">3 - Possible</option>
                              <option value="2">2 - Unlikely</option>
                              <option value="1">1 - Rare</option>
                            </>
                          )}
                        </select>
                      </div>
                      <div>
                        <label className="block text-sm font-medium text-gray-700">Severity</label>
                        <select className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500">
                          <option>Select...</option>
                          {matrixType === 'icao' ? (
                            <>
                              <option value="A">A - Catastrophic</option>
                              <option value="B">B - Hazardous</option>
                              <option value="C">C - Major</option>
                              <option value="D">D - Minor</option>
                              <option value="E">E - Negligible</option>
                            </>
                          ) : (
                            <>
                              <option value="5">5 - Catastrophic</option>
                              <option value="4">4 - Major</option>
                              <option value="3">3 - Moderate</option>
                              <option value="2">2 - Minor</option>
                              <option value="1">1 - Insignificant</option>
                            </>
                          )}
                        </select>
                      </div>
                    </div>
                  </div>
                ))}
              </div>
            ))}
          </div>
        ))}
      </div>
    </div>
  );
};

export default RiskAssessment;
